// Function to set a default cover image for groups created by the site admin
function my_custom_group_cover_image_for_admin( $settings = array() ) {
    // Check if we are within a group context
    if ( bp_is_group() ) {
        // Fetches the current group details
        $group = groups_get_current_group();

        // Set this to the user ID of the site admin
        $admin_id = 1; // Replace with the actual admin user ID

        // Check if the group creator is the site admin
        if ( $group->creator_id == $admin_id ) {
            // If the creator is the admin, set the default cover image
            $settings['default_cover'] = 'https://buddypress.local/wp-content/uploads/2023/11/road-g3567f8d60_1280.jpg'; // Replace with the URL of your default image
        }
    }

    // Return the settings, modified or not
    return $settings;
}

// Add the function to the BuddyPress filter hook to modify group cover image settings
add_filter( 'bp_before_groups_cover_image_settings_parse_args', 'my_custom_group_cover_image_for_admin' );

#include <iostream>
#include <stack>
#include <list>
#include <sstream>
#include<cmath>
using namespace std;

enum Type {
    Number, Operator, Brace, Unary, Defualt
};

struct Element {
    Type type;
    float value;
    Element() { type = Defualt; value = 0; }
    Element(Type type, float value) {
        this->type = type;
        this->value = value;
    }
};

ostream & operator<<(std::ostream & os, const Element & m) {
    switch (m.type)
    {
    case Number:
        os << m.value << " ";
        break;
    case Brace:
        os << ((m.value == 1) ? ("(") : (")")) << " ";
        break;
    case Operator:
        switch ((int)m.value)
        {
        case 1: os << "+ "; break;
        case 2: os << "- "; break;
        case 3: os << "* "; break;
        case 4: os << "/ "; break;
        default:
            break;
        }
        break;
    case Unary:
        os << "_ ";
        break;
    default:
        os << "ERR ";
        break;
    }
    return os;
}

int OperToNum(char c) {
    switch (c)
    {
    case '+':
        return 1;
        break;
    case '*':
        return 3;
        break;
    case '/':
        return 4;
        break;
    }
}

int main()
{
    stack<char> stk;
    stack<list<Element>::iterator> Stack;
    list<Element> lis;
    string str;
    getline(cin, str);
    bool ValidZagradi = true;

    for (char i : str)
    {
        if (i == '(' || i == '[' || i == '{')
            stk.push(i);

        if (i == ')')
            if (!stk.empty() && stk.top() == '(') stk.pop();
            else ValidZagradi = false;
        if (i == ']')
            if (!stk.empty() && stk.top() == '[') stk.pop();
            else ValidZagradi = false;
        if (i == '}')
            if (!stk.empty() && stk.top() == '{') stk.pop();
            else ValidZagradi = false;
    }
    if (ValidZagradi == false || !stk.empty())
        cout << "Loshi Zagradi\n";
    else {
        bool VnesuvaBr = false;
        float VlezenBr = 0.0f;
        lis.push_back(Element(Brace, 1));
        for (int i = 0; i < str.size(); i++) {
            char c = str[i];
            if (c >= '0' && c <= '9') {
                VnesuvaBr = true;
                VlezenBr *= 10;
                VlezenBr += c - '0';

                if (i + 1 >= str.size() || str[i + 1] < '0' || str[i + 1]>'9') {
                    lis.push_back(Element(Number, VlezenBr));
                    VlezenBr = 0; VnesuvaBr = false;
                }
            }
            if (c == '+' || c == '*' || c == '/') {
                lis.push_back(Element(Operator, OperToNum(c)));
            }
            if (c == '(' || c == '[' || c == '{') {
                lis.push_back(Element(Brace, 1));
            }
            if (c == ')' || c == ']' || c == '}') {
                lis.push_back(Element(Brace, 2));
            }
            if (c == '-') {
                if (lis.size() == 1 || ((--lis.end()))->type != Number && !((--lis.end())->type == Brace && (--lis.end())->value == 2))
                    lis.push_back(Element(Unary, 1));
                else
                    lis.push_back(Element(Operator, 2));
            }
        }
        lis.push_back(Element(Brace, 2));

        for (list<Element>::iterator it = lis.begin(); it != lis.end(); it++) {

            if (it->type == Brace) {
                if (it->value == 1) {
                    Stack.push(it);
                }
                else {
                    list<Element>::iterator LeftBracket = Stack.top(), RightBracket = it; Stack.pop();

                    //Presmetuvanje na Unaren Minus

                    for (list<Element>::iterator El = LeftBracket; El != RightBracket; El++) {
                        if (El->type == Unary) {
                            list<Element>::iterator Num = El; Num++;
                            if (Num->type != Number) {
                                cout << "GRESHEN IZRAZ"; return 0;
                            }
                            Num->value *= -1;
                            lis.erase(El);
                            El = Num;
                        }
                    }

                    //Presmetuvanje na * i /
                    for (list<Element>::iterator El = LeftBracket; El != RightBracket; El++) {
                        if (El->type == Operator && El->value > 2) {
                            list<Element>::iterator Numl = El, Numr = El; Numr++; Numl--;
                            if (Numr->type != Number || Numl->type != Number)
                            {
                                cout << "GRESHEN IZRAZ"; return 0;
                            }
                            if (El->value == 3)Numl->value *= Numr->value;
                            else if (El->value == 4) Numl->value /= Numr->value;
                            else {
                                cout << "GRESHEN IZRAZ"; return 0;
                            }
                            lis.erase(El);
                            lis.erase(Numr);
                            El = Numl;
                        }
                    }
                    //Presmetuvanje na + i bin -
                    for (list<Element>::iterator El = LeftBracket; El != RightBracket; El++) {
                        if (El->type == Operator && El->value <= 2) {
                            list<Element>::iterator Numl = El, Numr = El; Numr++; Numl--;
                            if (Numr->type != Number || Numl->type != Number)
                            {
                                cout << "GRESHEN IZRAZ"; return 0;
                            }
                            if (El->value == 2)Numl->value -= Numr->value;
                            else if (El->value == 1) Numl->value += Numr->value;
                            else {
                                cout << "GRESHEN IZRAZ"; return 0;
                            }
                            lis.erase(El);
                            lis.erase(Numr);
                            El = Numl;
                        }
                    }
                    //Brishenje na zagradi
                    list<Element>::iterator Num = RightBracket; Num--;
                    lis.erase(LeftBracket);
                    lis.erase(RightBracket);
                    it = Num;


                }
            }
        }

        for (Element el : lis) {
            cout << el;
        }cout << endl;

    }
}

package com.cerbon.bosses_of_mass_destruction.entity.custom.gauntlet;

import com.cerbon.bosses_of_mass_destruction.api.maelstrom.general.event.Event;
import com.cerbon.bosses_of_mass_destruction.api.maelstrom.general.event.EventScheduler;
import com.cerbon.bosses_of_mass_destruction.api.maelstrom.general.event.TimedEvent;
import com.cerbon.bosses_of_mass_destruction.api.maelstrom.static_utilities.MobUtils;
import com.cerbon.bosses_of_mass_destruction.api.maelstrom.static_utilities.RandomUtils;
import com.cerbon.bosses_of_mass_destruction.api.maelstrom.static_utilities.VecUtils;
import com.cerbon.bosses_of_mass_destruction.entity.util.IDataAccessorHandler;
import com.cerbon.bosses_of_mass_destruction.particle.BMDParticles;
import com.cerbon.bosses_of_mass_destruction.particle.ClientParticleBuilder;
import com.cerbon.bosses_of_mass_destruction.util.BMDColors;
import net.minecraft.network.syncher.EntityDataAccessor;
import net.minecraft.world.phys.Vec3;

public class GauntletClientEnergyShieldHandler implements IDataAccessorHandler {
    private final GauntletEntity entity;
    private final EventScheduler eventScheduler;

    private float energizedRenderAlpha = 0.0f;
    private final ClientParticleBuilder energizedParticles = new ClientParticleBuilder(BMDParticles.SPARKLES.get())
            .brightness(BMDParticles.FULL_BRIGHT)
            .color(BMDColors.LASER_RED)
            .colorVariation(0.2)
            .scale(0.25f);

    public GauntletClientEnergyShieldHandler(GauntletEntity entity, EventScheduler eventScheduler) {
        this.entity = entity;
        this.eventScheduler = eventScheduler;
    }

    public float getRenderAlpha(){
        return energizedRenderAlpha;
    }

    @Override
    public void onSyncedDataUpdated(EntityDataAccessor<?> data) {
        if (GauntletEntity.isEnergized == data && entity.getEntityData().get(GauntletEntity.isEnergized) && entity.level.isClientSide()){
            eventScheduler.addEvent(new TimedEvent(() -> energizedRenderAlpha += 0.1f, 0, 10, () -> false));
            eventScheduler.addEvent(
                    new Event(
                            () -> true,
                            this::spawnParticles,
                            () -> !entity.isAlive() || !entity.getEntityData().get(GauntletEntity.isEnergized)
                    )
            );
        } else
            energizedRenderAlpha = 0.0f;
    }

    private void spawnParticles(){
        Vec3 look = entity.getLookAngle();
        Vec3 cross = look.cross(VecUtils.yAxis);
        Vec3 rotatedOffset = VecUtils.rotateVector(cross, look, RandomUtils.range(0, 359));
        Vec3 particlePos = MobUtils.eyePos(entity).add(rotatedOffset);
        Vec3 particleVel = VecUtils.rotateVector(rotatedOffset, look, 90).scale(0.1);
        energizedParticles.build(particlePos, particleVel);
    }

    public void initDataTracker(){
        entity.getEntityData().define(GauntletEntity.isEnergized, false);
    }
}

