#include <iostream>

using namespace std;

// Fungsi untuk konversi ke biner
string toBinary(int number) {
    string binaryResult = "";
    
    while (number > 0) {
        int remainder = number % 2;
        binaryResult = to_string(remainder) + binaryResult;
        number /= 2;
    }

    return binaryResult.empty() ? "0" : binaryResult;
}

// Fungsi untuk konversi ke heksadesimal
string toHexadecimal(int number) {
    string hexResult = "";
    const char hexChars[] = "0123456789ABCDEF";
    
    while (number > 0) {
        int remainder = number % 16;
        hexResult = hexChars[remainder] + hexResult;
        number /= 16;
    }

    return hexResult.empty() ? "0" : hexResult;
}

// Fungsi untuk konversi ke oktal
string toOctal(int number) {
    string octalResult = "";
    
    while (number > 0) {
        int remainder = number % 8;
        octalResult = to_string(remainder) + octalResult;
        number /= 8;
    }

    return octalResult.empty() ? "0" : octalResult;
}

int main() {
    int inputNumber;
    int choice;

    cout << "Masukkan bilangan bulat: ";
    cin >> inputNumber;

    cout << "Pilih konversi yang diinginkan:\n";
    cout << "1. Biner\n";
    cout << "2. Heksadesimal\n";
    cout << "3. Oktaf\n";
    cout << "Pilihan Anda: ";
    cin >> choice;

    switch (choice) {
        case 1:
            cout << "Hasil konversi ke biner: " << toBinary(inputNumber) << endl;
            break;
        case 2:
            cout << "Hasil konversi ke heksadesimal: " << toHexadecimal(inputNumber) << endl;
            break;
        case 3:
            cout << "Hasil konversi ke oktal: " << toOctal(inputNumber) << endl;
            break;
        default:
            cout << "Pilihan tidak valid." << endl;
    }

    return 0;
}

