class Solution {
    final int INF = (int) 1e9;
    public int minCost(int[][] grid) {
        int[][] dirs = {null, {0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        int m = grid.length, n = grid[0].length;
        var q = new ArrayDeque<int[]>(); // [x,y]
        int[][] minCost = new int[m][n];
        for(var row: minCost) Arrays.fill(row, INF);

        q.offer(new int[]{0, 0});
        minCost[0][0] = 0;

        while(!q.isEmpty()){
            var curr = q.poll();
            int x = curr[0], y = curr[1];
            if(x == m - 1 && y == n - 1) return minCost[x][y];
            for(int i = 1; i <= 4; i++){
                int nx = x + dirs[i][0], ny = y + dirs[i][1];
                if(!isValid(nx, ny, m, n)) continue;
                int w = grid[x][y] == i ? 0 : 1;
                int newCost = minCost[x][y] + w;
                if(newCost < minCost[nx][ny]){
                    if(w == 0) q.addFirst(new int[]{nx, ny});
                    else q.addLast(new int[]{nx, ny});
                    minCost[nx][ny] = newCost;
                }
            }
        }
        return 0;
    }
    boolean isValid(int x, int y, int m, int n) {
        return x >= 0 && x < m && y >= 0 && y < n;
    }
}

