int binarysearch(int arr[],int n, int key)
{
    int l=0;
    int r=n-1;
    while(l<=r)
    {
        int mid=(l+r)/2;
        if(key==arr[mid])
        {
            return mid;
        }
        else if(key<arr[mid])
        {
            r=mid-1;
        }
        else if(key>arr[mid])
        {
            l=mid+1;
        }
    }
    if(l>r)
    {
        return -1;
    }
}
